    [],nt"num_tags": 4,nt"name": "clarence-cannon-national-wildlife-refuge-annual-narrative-report-calendar-year-1983",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Clarence
    Cannon NWR outlines Refuge accomplishments during the 1983 calendar year. The report
    begins with a summary of the year's highlights and weather conditions. The report
    includes a planning section which discusses management planning and research and
    investigations. Refuge administration is outlined; information about personnel,
    youth programs, manpower programs, volunteer programs, funding, and safety is given.
    Habitat management is also covered; subjects include wetlands, croplands, grasslands,
    and pest control. The wildlife section of the report discusses wildlife diversity,
    endangered and threatened species, waterfowl, marsh birds and waterbirds, raptors,
    game mammals, animal control, and disease control. The public uses of the Refuge
    described in this report include interpretive programs and law enforcement. The
    equipment and facilities section of the report provides information about new construction,
    major maintenance, equipment replacement, communication systems, and energy conservation.
    Cooperative programs and items of interest are provided at the end.",nt"owner_org":
